package strStr

import (
	"fmt"
	"testing"
)

func TestStrStr(t *testing.T) {
	cases := []struct{
		haystack  	string
		needle 		string
		want 		int
	} {
		{
			"aaccabbababcbba",
			"ababc",
			7,
		},
		{
			"hello",
			"ll",
			2,
		},
		{
			"aaaaa",
			"bba",
			-1,
		},
		{
			"ad",
			"",
			0,
		},
		{
			"",
			"a",
			-1,
		},
		{
			"",
			"",
			-1,
		},
		{
			"mississippi",
			"issip",
			4,
		},
		{
			"aabaaabaaac",
			"aabaaac",
			4,
		},
	}

	for k, v := range cases {
		t.Run(fmt.Sprint("test", k), func(t *testing.T) {
			got := strStr(v.haystack, v.needle)
			if got != v.want {
				t.Errorf("got %v want %v", got, v.want)
			}
		})
	}
}